script: |
  super -f text -I q1611.spq | sort > q1611.out

inputs:
  - name: q1611.spq
    data: |
      SELECT ALL + col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE col0 NOT BETWEEN ( - col1 ) AND ( + col0 * col2 + - col0 * + ( col1 ) );
  - name: tab2

outputs:
  - name: q1611.out
    data: |
      23
      40
      58
